import styled from "styled-components";

const StyledButton = styled.button`
    width: 100px;
    height: 40px;
    padding: 10px 20px;
    font-size: 1.3rem;
    line-height: 8px;
    color: white;
    background-color: ${(props) => props.$bgcolor};
    border-radius: 10px;
`;

export function Button({bgcolor, title}) {
    return (<>
        <styledButton $bgcolor={bgcolor}>{title}</styledButton>
    </>);
}
